import logo from './logo.svg';
import './App.css';
import Alert from './components/Alert';
import Button from './components/Buttons';

function App() {
  return (
    <div className="App">
      <section className="container mt-5">
        <div className="row">
          <div className="col-md-8 offset-md-2 text-center">
            <h1 className="display-4">Welcome to Our Website</h1>
            <p className="lead">
              We are excited to have you here. Explore our content and learn more about what we offer.
            </p>
            <hr className="my-4" />
            <p>
              Our website is designed to provide you with the best resources and solutions for your needs.
              Dive in and discover a world of possibilities!
            </p>
            <a className="btn btn-primary btn-lg" href="#learn-more" role="button">
              Learn More
            </a>
          </div>
        </div>
      </section>
    </div>
  );
}

export default App;
